import React from 'react'
import styled from 'styled-components'


const WrapperStyled = styled.div`
max-width: 1024px; 
margin : auto;
padding: 3em
`





export default function Wrapper(props) {
    return (
        <WrapperStyled>
            {props.children}
        </WrapperStyled>
    )
}
